    'help.WhatShouldIDoIfISuspectAFraudulentSeller': '\u0DB8\u0DB8 \u0DC0\u0D82\u0DA0\u0DB1\u0DD2\u0D9A \u0D85\u0DBD\u0DD9\u0DC0\u0DD2\u0D9A\u0DBB\u0DD4\u0DC0\u0D9A\u0DD4 \u0D9C\u0DD0\u0DB1 \u0DC3\u0DD0\u0D9A \u0D9A\u0DC5\u0DC4\u0DDC\u0DAD\u0DCA \u0DB8\u0DA7 \u0D9A\u0DC5 \u0DC4\u0DD0\u0D9A\u0DCA\u0D9A\u0DDA \u0D9A\u0DD4\u0DB8\u0D9A\u0DCA\u0DAF?',
    'help.WhatShouldIDoIfISuspectAFraudulentSeller_content': '\u0DC0\u0DCA\u200D\u0DBA\u0DCF\u0DA2 \u0DC4\u0DDD \u0DC0\u0D82\u0DA0\u0DB1\u0DD2\u0D9A \u0DB4\u0DC5 \u0D9A\u0DD2\u0DBB\u0DD3\u0DB8\u0D9A\u0DCA \u0D85\u0DA9\u0DC0\u0DD2\u0DBA\u0DD9\u0DC4\u0DD2 \u0D87\u0DAD\u0DD2 \u0DB6\u0DC0 \u0D94\u0DB6\u0DA7 \u0DAF\u0DD0\u0DB1\u0DD4\u0DB1\u0DC4\u0DDC\u0DAD\u0DCA, \u0D9A\u0DBB\u0DD4\u0DAB\u0DCF\u0D9A\u0DBB <<CONTACTLINK>>\u0DB1\u0DD3\u0DAD\u0DD2 \u0D9A\u0DBB\u0DD4\u0DAB\u0DD4 <</CONTACTLINK>> \u0DC4\u0DD2\u0DAF\u0DD3 \u0D85\u0DB4 \u0DC4\u0DCF \u0DC3\u0DB8\u0DCA\u0DB6\u0DB1\u0DCA\u0DB0 \u0DC0\u0DB1\u0DCA\u0DB1.',
    'terms.TermsOfUse': '\u0DB7\u0DCF\u0DC0\u0DD2\u0DAD \u0D9A\u0DDC\u0DB1\u0DCA\u0DAF\u0DDA\u0DC3\u0DD2',
